sourcesContent:
import styled from "styled-components";
import tops from "../../assets/images/tops.jpg";

export const Container = styled.div`
  height: 250px;
  width: 100%;
  background-color: green;
  margin-top: 1rem;
  border-radius: 2rem;
  background: url(${tops});
  background-position: center;
  background-size: cover;
`;
